import React from 'react';
import './NavBar.css';

const NavBar = () => {
  return (
    <nav className="nav-bar">
      <img src="/img/CornGrub.png" alt=""/>
      <ul className="nav-links">
        <li className="nav-item">
            <a >HOME</a>
        </li>
        <li className="nav-item">
            <a >ORDER</a>
        </li>
        <li className="nav-item">
            <a href="#">CART</a>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
